 PowerISO v3.9 | 1.07 Mb

Create, edit, extract, convert, compress, encrypt, mount CD image file!!! PowerISO is a powerful image processing and file compression tool, which allows you to create, extract, compress, edit and convert ISO/BIN image files, and mount these files with internal virtual drive. And most of all, the compressed files can be used directly without decompressing. PowerISO v3.9 was released last January 21, 2008.

Main Features:- Support almost all CD/DVD-ROM image file formats (ISO, BIN, NRG, IMG, DAA and so on).
Note: DAA (Direct-Access-Archive) is an advanced format for image file, which supports some advanced features, such as compression, password protection, and splitting to multiple volumes. It can be handled directly just like other formats, such as ISO, BIN, ...
